import './PurchaseOrderGrid.css';

const PurchaseOrderGrid = ({orders, orderDetails}) => (
    <div className="purchaseOrderGrid">

        {orders.map(order => 
            <div>{order.customer_id}</div>
        )}
    </div>
)

export default PurchaseOrderGrid;
